package main

import (
	"fmt"
	"strings"
)

type Node struct {
	prefix string
	Nodes  []*Node
}

func CommonPrefix(s1, s2 string) (bool, string) {
	var use string
	if len(s1) < len(s2) {
		use = s1
	} else {
		use = s2
	}

	var x int
	for ; x < len(use); x++ {
		if s1[x] != s2[x] {
			break
		}
	}
	if x == 0 { return false, "" }
	return true, use[:x]
}

func New(prefix string, nodes ...*Node) *Node {
	for idx := 0; idx < len(nodes); idx++ {
		nodes[idx].prefix = nodes[idx].prefix[len(prefix):]
	}
	return &Node{prefix, nodes}
}

func (n *Node) Insert(s string) {
	n.insert("", s)
}

func (n *Node) insert(pre, s string) {
	for idx, node := range n.Nodes {

		if strings.HasPrefix(pre+node.prefix, s) {
			n.Nodes[idx] = New(s[len(pre):], node)
			return
		}

		if strings.HasPrefix(s, pre+node.prefix) {
			node.insert(pre+node.prefix, s)
			return
		}

	}
	n.AddNode(s[len(pre):])
}

func (n *Node) AddNode(s string) {
	n.Nodes = append(n.Nodes, &Node{s, []*Node{}})
}

func (n *Node) contains(s, pre string) bool {
	if len(s) == 0 {
		return false
	}
	for _, node := range n.Nodes {
		if pre+node.prefix == s {
			return true
		}
		if strings.HasPrefix(s, pre+node.prefix) {
			return node.contains(s, pre+node.prefix)
		}
	}
	return false
}

func (n *Node) Contains(s string) bool {
	return n.contains(s, "")
}

func (n Node) String() string {

	var out string
	for _, node := range n.Nodes {
		out += node.Display(0) + "\n"
	}
	return out
}

func (n Node) Display(numtabs int) string {
	var out string
	tabs := strings.Repeat("\t", numtabs)
	out += fmt.Sprintf("\n%sNode with prefix: %s\n", tabs, n.prefix)
	for _, node := range n.Nodes {
		if len(node.Nodes) > 0 {
			out += node.Display(numtabs + 1)
			continue
		}
		out += tabs + "Subnode: " + node.prefix + "\n"
	}
	return out
}

